  \"2013-03-15T21:04:42.409788\",\n\t\"name\": \"streamnet-query-system-protected-areas\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Beginning in 1983, the Northwest Power
  Planning Council (Council) directed extensive studies of existing habitat and has
  analyzed alternative means of protection. In 1988, the Council concluded that: 1)
  the studies had identified fish and wildlife resources of critical importance to
  the region; 2) mitigation techniques cannot assure that all adverse impacts of hydroelectric
  development on these fish and wildlife populations will be mitigated; 3) even small
  hydroelectric projects may have unacceptable individual and cumulative impacts on
  these resources; and 4) protecting these resources and habitats from hydroelectric
  development is consistent with an adequate, efficient, economical, and reliable
  power supply. The Council, relying on these studies, designated certain river reaches
  in the basin as \"protected areas,\" where the Council believes hydroelectric development
  would have unacceptable risks of loss to fish and wildlife species of concern, their
  productive capacity or their habitat. River reaches to be protected are those reaches
  or portions of reaches listed on the \"Protected Areas List\" adopted by the Council
  on August 10, 1988, and subsequently. For each river reach listed on the Protected
  Areas List, the fish and wildlife to be protected are those on the list. This dataset
  describes reaches or segments of reaches included in the \"Protected Areas List.\"
  This data category is available through StreamNet's online query system, which allows
  users to explore and filter the StreamNet database and download selected results.
  For help in using the StreamNet query system, please consult the user guide, available
  at http://www.streamnet.org/onlinehelp/user_guide_03.html\",\n\t\"license_title\":
